import {takeEvery} from 'redux-saga/effects'; 

function* fetchCollectionsAsync() {
    yield console.log("Fired");
}

export function* fetchShopData() {
    yield takeEvery('FETCH_SHOP_DATA_START', fetchCollectionsAsync);
}
